import Link from "next/link";
export default props => {
	const { post } = props;
	console.log("PROPS", props);
	console.log("PROPS", post);
	return (
		<li>
			<Link href="/p/[id]" as={`/p/${props.id}`}>
				{/* <a>{props.title}</a> */}
				<a>{post.name}</a>
			</Link>
			<style jsx>{`
				h1,
				a {
					font-family: "Arial";
				}

				ul {
					padding: 0;
				}

				li {
					list-style: none;
					margin: 5px 0;
				}

				a {
					text-decoration: none;
					color: blue;
				}

				a:hover {
					opacity: 0.6;
				}
			`}</style>
		</li>
	);
};
